  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA Contract: EA133C11CQ0009 NOAA Task
  Order Number: T0013 The PS FY13 GA DNR Elevation Data Task Order involves collecting
  and delivering topographic elevation point data derived from multiple return light
  detection and ranging (LiDAR) measurements in 4 counties in Georgia. The Statement
  of Work (SOW) was developed by the National Oceanic and Atmospheric Administration's
  (NOAA) Office for Coastal Management (referred to as the Center) in partnership
  with the Georgia Department of Natural Resources (GADNR) Environmental Protection
  Division (EPD). The counties included are Barrow,Clarke, Madison and Oglethorpe.
  The data collected for these 4 counties will exhibit Hydro Flattened DEMs for inclusion
  into the National Elevation Dataset (NED). The purpose of the data is for use in
  coastal management decision making, including applications such as floodplain mapping
  and water rights management. LiDAR was collected at 1.0 points per square meter
  (1.0m GSD) for Barrow, Clarke, Madison and Oglethorpe Counties.This area was flown
  during snow free and leaf-off conditions.\",\n\t\"license_title\": null,\n\t\"extras\":
